    x++;
    y--;
    return x + y
}
// 等同于
s = function(x, y) {
    x++;
    y--;
    return x + y;
};
//例如
f = v => v;
//上面的箭头函数等同于：
f = function(v) {
    return v;
};

f = () => 5;
// 等同于
f = function() { return 5 };

sum = (num1, num2) => num1 + num2;

// 等同于
sum = function(num1, num2) {
    return num1 + num2;
};
//如果箭头函数的代码块部分多于一条语句，就要使用大括号将它们括起来，并且使用return语句返回。
sum = (num1, num2) => { return num1 + num2; }
    //由于大括号被解释为代码块，所以如果箭头函数直接返回一个对象，必须在对象外面加上括号。
getTempItem = id => ({ id: id, name: "Temp" });
//箭头函数可以与变量解构结合使用
