组件命名

有意义的， 简短，具有可读性。2-3个单词
符合自定义元素规范，使用-连字符分隔单词， 如app-header

组件单一原则

每一个vue组件专注于解决单一的问题，独立，可复用
一个组件尽量不要超过100行，如果组件太臃肿，需要拆分成更小的组件

props原子化
组件的props尽量使用原始数据类型，避免使用复杂对象
 // 不适用复杂对象
 const option = {title:'xxx', inApp: true}


  // 使用原始数据类型
  // 注意inApp驼峰的props书写在组件标记内需要改成in-app类型
  // 注意props值传入的如果不是字符串，需要v-bind:props来绑定

验证组件的props
 // 尽量不使用简写props
 export default {
  props: ['title', 'isApp']
 }

 // 验证props
  export default {
     props: {
         title: {
             type: String,
             default: ,
             required: true
         },
         isApp: {
             type: Boolean,
             default: false
         }
     }
 }
合理使用this
 // 组件内不要出现如下之类
 const self = this
 // 充分利用es6特性，使用this
 created(){
     this.title = 123
 }
组件使用name
 // 单一组件的导出不建议指定名称, 直接使用default导出
 export default {}
 // 组件建议添加name属性
 export default {
     name: 'appHeader"
 }
组件不要使用双向绑定的props
 // 不要使用.sync类型的props

