     props: {
         type: String,
         twoway: true
     }
 }
 // 子组件通知父级数据变更，应采用调用父级传入的函数型props回调，或者事件通知的方式
避免使用this.$parent
直接访问上下文降低了组建的复用性，应避免使用，尽量通过事件通知
尽量使用this.$http而不是jquery.ajax
vue组件应尽量使用自己的resource插件，符合promise规范
 // 最外层需要将插件引入
