 import VueResource from 'vue-resource'
 Vue.use(VueResource)
组件内尽量不要直接使用window上的全局变量
 // 不要使用window上的全局变量，降低组件复用性和增加维护成本
 this.$http.get(APIURL, {})

 // 通过props传入组件的所有外部依赖

 this.$http.get(this.api, {})
