Airbnb React/JSX 编码规范
算是最合理的React/JSX编码规范之一了
此编码规范主要基于目前流行的JavaScript标准，尽管某些其他约定(如async/await，静态class属性)可能在不同的项目中被引入或者被禁用。目前的状态是任何stage-3之前的规范都不包括也不推荐使用。
内容目录

基本规范
Class vs React.createClass vs stateless
Mixins
命名
声明模块
代码对齐
单引号还是双引号
空格
属性
Refs引用
